import React from "react";
import "./About.css"; // Ensure correct CSS import
import Footer from "../Footer";

function About() {
    return (
        <div className="about">
            <div className="about-image">
                {/* Image goes here */}
                <img src="/src/assets/img/HORTI.jpg" alt="Invernadero" />
            </div>
            <div className="about-content">
                <h1>About Us</h1>
                <p>
                    Leading in agricultural innovation, we specialize in advanced irrigation control and automation solutions. Committed to sustainability and efficiency, our expert team integrates the latest technologies for customized, eco-friendly systems. More than a company, we are strategic partners in agricultural efficiency and sustainability.
                </p>
            </div>
            <Footer />
        </div>
    );
}

export default About;
